import { useState } from "react";

function LoginPage() {

    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");

    /** Arrow functions to handle authentication */
    const handleUsername = (event) => {
        setUsername(event.target.value);
    }
    const handlePassword = (event) => {
        setPassword(event.target.value);
    }
    
    return(
        <div>
            <h1>Login Page</h1>
            <div className="login-container">
                <h2>Sign in</h2>
                <input
                    type="text"
                    placeholder="Username"
                    value={username}
                    onChange={handleUsername} //need to write handleUsername function
                />
                <br/>
                <br/>
                <input
                    type="password"
                    placeholder="Password"
                    value={password}
                    onChange={handlePassword} //need to write handlePassword function
                />
                <input
                    type="button"
                    value="Sign In"
                    //need to write handleLogin function and add onClick={handleLogin}
                />
            </div>
        </div>
    )
    
}

export default LoginPage;
